import React from 'react'
import moment from 'moment'

const InvestmentEntry = props => {
    const { name, amountPurchased, purchasePrice, entryDate } = props
    return(
        <div className='investment-entry'>
            {/* <span{moment(entryDate).format('LL')}></span> */}
            <p>{name} {amountPurchased} ${purchasePrice}</p>
        </div>
    )
}

export default InvestmentEntry
